import { combineReducers } from "redux";
import posts from "./posts.js";
import testReducer from "./testReducer.js";
import userReducer from "./userReducer"
import auth from "./auth.js";
export default combineReducers({
    posts:posts,
    auth:auth,
    test:testReducer,
    user:userReducer
    
})
